	('AddGeometryColumn', 'def', 'mysql', 'AddGeometryColumn', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'begin\n  set @qwe= concat(\'ALTER TABLE \', t_schema, \'.\', t_name, \' ADD \', geometry_column,\' GEOMETRY REF_SYSTEM_ID=\', t_srid); PREPARE ls from @qwe; execute ls; deallocate prepare ls; end', NULL, NULL, 'SQL', 'NO', 'CONTAINS SQL', NULL, 'DEFINER', '2017-05-25 16:50:18', '2017-05-25 16:50:18', '', '', 'root@localhost', 'utf8', 'utf8_general_ci', 'latin1_swedish_ci'),
	('DropGeometryColumn', 'def', 'mysql', 'DropGeometryColumn', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'begin\n  set @qwe= concat(\'ALTER TABLE \', t_schema, \'.\', t_name, \' DROP \', geometry_column); PREPARE ls from @qwe; execute ls; deallocate prepare ls; end', NULL, NULL, 'SQL', 'NO', 'CONTAINS SQL', NULL, 'DEFINER', '2017-05-25 16:50:18', '2017-05-25 16:50:18', '', '', 'root@localhost', 'utf8', 'utf8_general_ci', 'latin1_swedish_ci'),
	('logCashier', 'def', 'smartshop', 'logCashier', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN\r\nIF EXISTS (select Id from Cashiers where Id = Id1) THEN\r\nBEGIN\r\nselect Password into @dbPassword from Cashiers where Id = Id1; -- and Password = AES_ENCRYPT(Password1,SHA2(Id1,512));\r\nIF (@dbPassword = AES_ENCRYPT(Password1,SHA2(Id1,512))) THEN\r\nBEGIN\r\nselect * from Cashiers where Id = Id1 and Password = AES_ENCRYPT(Password1,SHA2(Id1,512));\r\nEND;\r\nELSE\r\nBEGIN\r\nselect null;\r\nEND;\r\nEND IF;\r\nEND;\r\nELSE\r\nBEGIN\r\nselect null;\r\nEND;\r\nEND IF;\r\nEND', NULL, NULL, 'SQL', 'NO', 'CONTAINS SQL', NULL, 'DEFINER', '2017-05-16 23:08:37', '2017-05-16 23:08:37', 'STRICT_TRANS_TABLES,ERROR_FOR_DIVISION_BY_ZERO,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION', '', 'root@%', 'utf8mb4', 'utf8mb4_general_ci', 'latin1_swedish_ci'),
	('regCashier', 'def', 'smartshop', 'regCashier', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN\r\ninsert into Cashiers (Id, Password, Name, Surname) values (Id1, AES_ENCRYPT(Password1,SHA2(Id1,512)), Name1, Surname1);\r\nEND', NULL, NULL, 'SQL', 'NO', 'CONTAINS SQL', NULL, 'DEFINER', '2017-05-15 22:32:15', '2017-05-15 22:32:15', 'STRICT_TRANS_TABLES,ERROR_FOR_DIVISION_BY_ZERO,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION', '', 'root@%', 'utf8mb4', 'utf8mb4_general_ci', 'latin1_swedish_ci'),
	('reportDay', 'def', 'smartshop', 'reportDay', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN\r\nselect p.Name, SUM(o.Count) as \'Sum\', (p.Price * SUM(o.Count)) as \'TotalPrice\'\r\nfrom Orders o join Transactions t join Products p\r\nwhere o.TransactionId = t.IdTransaction and o.ProductId = p.IdProduct and o.`Return` = 0\r\nand day(t.Date) = day(curdate()) group by Name with rollup;\r\nEND', NULL, NULL, 'SQL', 'NO', 'CONTAINS SQL', NULL, 'DEFINER', '2017-06-05 16:31:35', '2017-06-05 16:31:35', 'STRICT_TRANS_TABLES,ERROR_FOR_DIVISION_BY_ZERO,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION', '', 'root@%', 'utf8', 'utf8_general_ci', 'latin1_swedish_ci'),
	('reportMonth', 'def', 'smartshop', 'reportMonth', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN\r\nselect p.Name, SUM(o.Count) as \'Sum\', (p.Price * SUM(o.Count)) as \'TotalPrice\'\r\nfrom Orders o join Transactions t join Products p\r\nwhere o.TransactionId = t.IdTransaction and o.ProductId = p.IdProduct and o.`Return` = 0\r\nand month(t.Date) = month(curdate()) group by Name with rollup;\r\nEND', NULL, NULL, 'SQL', 'NO', 'CONTAINS SQL', NULL, 'DEFINER', '2017-06-05 19:53:16', '2017-06-05 19:53:16', 'STRICT_TRANS_TABLES,ERROR_FOR_DIVISION_BY_ZERO,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION', '', 'root@%', 'utf8mb4', 'utf8mb4_general_ci', 'latin1_swedish_ci'),
	('returnProduct', 'def', 'smartshop', 'returnProduct', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN\r\nIF EXISTS (select IdOrder from Orders where IdOrder = IdOrder1 AND Count >= Count1 AND Count1 >= 1 AND `Return` = 0) THEN\r\nBEGIN\r\nselect Count into @Count from Orders where IdOrder = IdOrder1;\r\nselect Price into @Price from Products p join Orders o \r\nwhere p.IdProduct = o.ProductId and o.IdOrder = IdOrder1;\r\nselect TransactionId into @TransactionId from Orders where IdOrder = IdOrder1;\r\nIF (@Count = Count1) THEN\r\nBEGIN\r\nupdate Orders set `Return` = 1 where IdOrder = IdOrder1;\r\nupdate Transactions set TotalPrice = TotalPrice - (@Price * Count1)\r\nwhere IdTransaction = @TransactionId;\r\nEND;\r\nELSE\r\nBEGIN\r\ninsert into Orders (ProductId, TransactionId, `Return`, Count) \r\nselect ProductId, TransactionId, `Return`, (Count - Count1) from Orders\r\nwhere IdOrder = IdOrder1;\r\nupdate Orders set `Return` = 1, Count = Count1 where IdOrder = IdOrder1;\r\nupdate Transactions set TotalPrice = TotalPrice - (@Price * Count1)\r\nwhere IdTransaction = @TransactionId;\r\nEND;\r\nEND IF;\r\nEND;\r\nEND IF;\r\nEND', NULL, NULL, 'SQL', 'NO', 'CONTAINS SQL', NULL, 'DEFINER', '2017-06-01 19:21:13', '2017-06-01 19:21:13', 'STRICT_TRANS_TABLES,ERROR_FOR_DIVISION_BY_ZERO,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION', '', 'root@%', 'utf8mb4', 'utf8mb4_general_ci', 'latin1_swedish_ci'),
	('test', 'def', 'smartshop', 'test', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'begin\r\nselect * from Transactions;\r\nend', NULL, NULL, 'SQL', 'NO', 'CONTAINS SQL', NULL, 'DEFINER', '2017-05-15 21:17:25', '2017-05-15 21:17:25', 'STRICT_TRANS_TABLES,ERROR_FOR_DIVISION_BY_ZERO,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION', '', 'root@%', 'utf8mb4', 'utf8mb4_general_ci', 'latin1_swedish_ci'),
	('topProducts', 'def', 'smartshop', 'topProducts', 'PROCEDURE', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'SQL', 'BEGIN\r\nselect @number:=@number + 1 as \'Ordinal\', Name, ordercount as \'TotalSales\'\r\nfrom (\r\nselect Name, SUM(Count) as ordercount from\r\nOrders o join Products p \r\nwhere o.ProductId = p.IdProduct group by Name order by SUM(Count)\r\ndesc limit 10\r\n) t1, (select @number:=0) t2;\r\nEND', NULL, NULL, 'SQL', 'NO', 'CONTAINS SQL', NULL, 'DEFINER', '2017-05-25 17:22:21', '2017-05-25 17:22:21', 'STRICT_TRANS_TABLES,ERROR_FOR_DIVISION_BY_ZERO,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION', '', 'root@%', 'utf8mb4', 'utf8mb4_general_ci', 'latin1_swedish_ci');
