INSERT INTO `SYSTEM_VARIABLES` (`VARIABLE_NAME`, `SESSION_VALUE`, `GLOBAL_VALUE`, `GLOBAL_VALUE_ORIGIN`, `DEFAULT_VALUE`, `VARIABLE_SCOPE`, `VARIABLE_TYPE`, `VARIABLE_COMMENT`, `NUMERIC_MIN_VALUE`, `NUMERIC_MAX_VALUE`, `NUMERIC_BLOCK_SIZE`, `ENUM_VALUE_LIST`, `READ_ONLY`, `COMMAND_LINE_ARGUMENT`) VALUES
	('BINLOG_ROW_IMAGE', 'FULL', 'FULL', 'COMPILE-TIME', 'FULL', 'SESSION', 'ENUM', 'Controls whether rows should be logged in \'FULL\', \'NOBLOB\' or \'MINIMAL\' formats. \'FULL\', means that all columns in the before and after image are logged. \'NOBLOB\', means that mysqld avoids logging blob columns whenever possible (eg, blob column was not changed or is not part of primary key). \'MINIMAL\', means that a PK equivalent (PK columns or full row if there is no PK in the table) is logged in the before image, and only changed columns are logged in the after image. (Default: FULL).', NULL, NULL, NULL, 'MINIMAL,NOBLOB,FULL', 'NO', 'REQUIRED'),
	('PERFORMANCE_SCHEMA', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Enable the performance schema.', NULL, NULL, NULL, 'OFF,ON', 'YES', 'OPTIONAL'),
	('SQL_MODE', '', 'STRICT_TRANS_TABLES,ERROR_FOR_DIVISION_BY_ZERO,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION', 'COMPILE-TIME', 'STRICT_TRANS_TABLES,ERROR_FOR_DIVISION_BY_ZERO,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION', 'SESSION', 'SET', 'Sets the sql mode', NULL, NULL, NULL, 'REAL_AS_FLOAT,PIPES_AS_CONCAT,ANSI_QUOTES,IGNORE_SPACE,IGNORE_BAD_TABLE_OPTIONS,ONLY_FULL_GROUP_BY,NO_UNSIGNED_SUBTRACTION,NO_DIR_IN_CREATE,POSTGRESQL,ORACLE,MSSQL,DB2,MAXDB,NO_KEY_OPTIONS,NO_TABLE_OPTIONS,NO_FIELD_OPTIONS,MYSQL323,MYSQL40,ANSI,NO_AUTO_VALUE_ON_ZERO,NO_BACKSLASH_ESCAPES,STRICT_TRANS_TABLES,STRICT_ALL_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ALLOW_INVALID_DATES,ERROR_FOR_DIVISION_BY_ZERO,TRADITIONAL,NO_AUTO_CREATE_USER,HIGH_NOT_PRECEDENCE,NO_ENGINE_SUBSTITUTION,PAD_CHAR_TO_FULL_LENGTH', 'NO', 'REQUIRED'),
	('PERFORMANCE_SCHEMA_EVENTS_WAITS_HISTORY_LONG_SIZE', NULL, '-1', 'COMPILE-TIME', '-1', 'GLOBAL', 'BIGINT', 'Number of rows in EVENTS_WAITS_HISTORY_LONG. Use 0 to disable, -1 for automated sizing.', '-1', '1048576', '1', NULL, 'YES', 'REQUIRED'),
	('INNODB_FT_CACHE_SIZE', NULL, '8000000', 'COMPILE-TIME', '8000000', 'GLOBAL', 'BIGINT UNSIGNED', 'InnoDB Fulltext search cache size in bytes', '1600000', '80000000', '0', NULL, 'YES', 'REQUIRED'),
	('PERFORMANCE_SCHEMA_MAX_COND_CLASSES', NULL, '80', 'COMPILE-TIME', '80', 'GLOBAL', 'BIGINT UNSIGNED', 'Maximum number of condition instruments.', '0', '256', '1', NULL, 'YES', 'REQUIRED'),
	('WSREP_SST_AUTH', NULL, '', 'COMPILE-TIME', '', 'GLOBAL', 'VARCHAR', 'Authentication for SST connection', NULL, NULL, NULL, NULL, 'NO', 'REQUIRED'),
	('PERFORMANCE_SCHEMA_MAX_COND_INSTANCES', NULL, '-1', 'COMPILE-TIME', '-1', 'GLOBAL', 'BIGINT', 'Maximum number of instrumented condition objects. Use 0 to disable, -1 for automated sizing.', '-1', '1048576', '1', NULL, 'YES', 'REQUIRED'),
	('LOG_SLAVE_UPDATES', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'Tells the slave to log the updates from the slave thread to the binary log. You will need to turn it on if you plan to daisy-chain the slaves', NULL, NULL, NULL, 'OFF,ON', 'YES', 'OPTIONAL'),
	('PERFORMANCE_SCHEMA_MAX_RWLOCK_CLASSES', NULL, '40', 'COMPILE-TIME', '40', 'GLOBAL', 'BIGINT UNSIGNED', 'Maximum number of rwlock instruments.', '0', '256', '1', NULL, 'YES', 'REQUIRED'),
	('INNODB_FLUSH_LOG_AT_TIMEOUT', NULL, '1', 'COMPILE-TIME', '1', 'GLOBAL', 'INT UNSIGNED', 'Write and flush logs every (n) second.', '0', '2700', '0', NULL, 'NO', 'OPTIONAL'),
	('BIG_TABLES', 'OFF', 'OFF', 'COMPILE-TIME', 'OFF', 'SESSION', 'BOOLEAN', 'Allow big result sets by saving all temporary sets on file (Solves most \'table full\' errors)', NULL, NULL, NULL, 'OFF,ON', 'NO', 'OPTIONAL'),
	('INNODB_FAST_SHUTDOWN', NULL, '1', 'COMPILE-TIME', '1', 'GLOBAL', 'INT UNSIGNED', 'Speeds up the shutdown process of the InnoDB storage engine. Possible values are 0, 1 (faster) or 2 (fastest - crash-like).', '0', '2', '0', NULL, 'NO', 'OPTIONAL'),
	('INNODB_LOCKS_UNSAFE_FOR_BINLOG', NULL, 'OFF', 'COMPILE-TIME', 'OFF', 'GLOBAL', 'BOOLEAN', 'DEPRECATED. This option may be removed in future releases. Please use READ COMMITTED transaction isolation level instead. Force InnoDB to not use next-key locking, to use only row-level locking.', NULL, NULL, NULL, 'OFF,ON', 'YES', 'NONE'),
	('MAX_LENGTH_FOR_SORT_DATA', '1024', '1024', 'COMPILE-TIME', '1024', 'SESSION', 'BIGINT UNSIGNED', 'Max number of bytes in sorted records', '4', '8388608', '1', NULL, 'NO', 'REQUIRED'),
	('PERFORMANCE_SCHEMA_MAX_MUTEX_INSTANCES', NULL, '-1', 'COMPILE-TIME', '-1', 'GLOBAL', 'BIGINT', 'Maximum number of instrumented MUTEX objects. Use 0 to disable, -1 for automated sizing.', '-1', '104857600', '1', NULL, 'YES', 'REQUIRED'),
